,'Point clé','http://vps273360.ovh.net:8080/public/ImageCours/ChapitreMelot/0002.jpg',0.08,0.26222222222222225,0.04888888888888889,0.7372727272727273,'Aminian','Engagement/','2016-05-14T15:00:23.307Z'),(224,'Comment cette capacité se développe-t-elle?','http://vps273360.ovh.net:8080/public/ImageCours/ChapitreMelot/0003.jpg',0.06545454545454546,0.24333333333333335,0.45111111111111113,0.37636363636363634,'Aminian','Curiosite/','2016-05-14T15:04:15.478Z'),(225,'Point important','http://vps273360.ovh.net:8080/public/ImageCours/ChapitreMelot/0004.jpg',0.05090909090909091,0.2577777777777778,0.11222222222222222,0.5654545454545454,'Aminian','Curiosite/Engagement/','2016-05-14T15:09:49.587Z'),(226,'Avant 5 ans, l\'enfant n\'a pas encore acquis les fonctions cognitives lui permettant de comprendre le concept de représentation mentale','http://vps273360.ovh.net:8080/public/ImageCours/ChapitreMelot/0004.jpg',0.08545454545454545,0.26,0.39111111111111113,0.4309090909090909,'Aminian','','2016-05-14T15:12:18.146Z'),(227,'Point clé','http://vps273360.ovh.net:8080/public/ImageCours/ChapitreMelot/0004.jpg',0.03909090909090909,0.2611111111111111,0.6611111111111111,0.4809090909090909,'Aminian','Engagement/','2016-05-14T15:14:14.153Z'),(228,'Point clé','http://vps273360.ovh.net:8080/public/ImageCours/ChapitreMelot/0004.jpg',0.06454545454545454,0.26666666666666666,0.6522222222222223,0.64,'Aminian','Engagement/','2016-05-14T15:15:25.021Z'),(229,'Compréhension de l\'élaboration de la représentation chez chaque individu','http://vps273360.ovh.net:8080/public/ImageCours/ChapitreMelot/0005.jpg',0.06545454545454546,0.25333333333333335,0.43777777777777777,0.28545454545454546,'Aminian','Engagement/','2016-05-14T15:17:41.782Z'),(230,'Point clé','http://vps273360.ovh.net:8080/public/ImageCours/ChapitreMelot/0005.jpg',0.07454545454545454,0.26,0.6844444444444444,0.8072727272727273,'Aminian','Engagement/','2016-05-14T15:19:31.718Z'),(231,'Résumé utile','http://vps273360.ovh.net:8080/public/ImageCours/ChapitreMelot/0006.jpg',0.10545454545454545,0.26222222222222225,0.06,0.7554545454545455,'Aminian','Curiosite/','2016-05-14T15:21:10.802Z'),(232,'Intéressant. Pourquoi?','http://vps273360.ovh.net:8080/public/ImageCours/ChapitreMelot/0006.jpg',0.07272727272727272,0.2577777777777778,0.6144444444444445,0.6654545454545454,'Aminian','Curiosite/Engagement/Surprise/','2016-05-14T15:23:16.967Z'),(233,'Il faut être bien éveillé pour lire cette phrase (surtout la fin, états mentaux reliés de façon causale, etc.) néanmoins elle a le mérite de susciter l\'intérêt.  ','http://vps273360.ovh.net:8080/public/ImageCours/ChapitreMelot/0001.jpg',0.24363636363636362,0.18555555555555556,0.7633333333333333,0.6154545454545455,'Elodie%20Brun','Curiosite/','2016-05-15T13:19:06.493Z'),(234,'Intéressant. Je comprend bien et suis certaine de cela mais j\'aimerais des exemples plus concrets pour mieux intégrer l\'information. Légère frustration mais toujours beaucoup de curiosité.','http://vps273360.ovh.net:8080/public/ImageCours/ChapitreMelot/0002.jpg',0.31363636363636366,0.27666666666666667,0.052222222222222225,0.3372727272727273,'Elodie%20Brun','Curiosite/Frustration/','2016-05-15T13:27:35.804Z'),(235,'Ce passage est un peu plus confus, je vois de quoi l\'auteur parle mais j\'aurais de la peine à l\'expliquer avec mes propres mots. Mais la curiosité m\'accompagne toujours.','http://vps273360.ovh.net:8080/public/ImageCours/ChapitreMelot/0002.jpg',0.10636363636363637,0.27444444444444444,0.04666666666666667,0.7381818181818182,'Elodie%20Brun','Curiosite/Confusion/','2016-05-15T13:35:25.420Z'),(236,'','http://vps273360.ovh.net:8080/public/ImageCours/ChapitreMelot/0002.jpg',0.17454545454545456,0.26555555555555554,0.3522222222222222,0.1481818181818182,'Elodie%20Brun','Curiosite/Confusion/','2016-05-15T13:36:36.720Z'),(237,'Cet exemple répond à mes interrogations du début.\nComme ma compréhension est plus claire le plaisir à lire commence à être de la partie.','http://vps273360.ovh.net:8080/public/ImageCours/ChapitreMelot/0003.jpg',0.44636363636363635,0.5444444444444444,0.15666666666666668,0.07,'Elodie%20Brun','Plaisir/Curiosite/','2016-05-15T13:46:26.267Z'),(238,'Où veulent-ils en venir?','http://vps273360.ovh.net:8080/public/ImageCours/ChapitreMelot/0001.jpg',0.15181818181818182,0.18444444444444444,0.13,0.6227272727272727,'Di%20Benedetto','Curiosite/','2016-05-15T12:51:53.434Z'),(239,'De nouveau un exemple qui stimule la curiosité et le plaisir. ','http://vps273360.ovh.net:8080/public/ImageCours/ChapitreMelot/0004.jpg',0.3518181818181818,0.26222222222222225,0.11333333333333333,0.4127272727272727,'Elodie%20Brun','Plaisir/Curiosite/','2016-05-15T13:55:32.707Z'),(240,'Difficile à comprendre à la première lecture!','http://vps273360.ovh.net:8080/public/ImageCours/ChapitreMelot/0002.jpg',0.2,0.24666666666666667,0.3566666666666667,0.2381818181818182,'Di%20Benedetto','Anxiete/','2016-05-15T12:57:56.068Z'),(241,'Besoin de lire ce passage plusieurs fois pour bien en saisir le sens. De ce fait un peu de frustration et moins de plaisir. Mais la curiosité est toujours là !','http://vps273360.ovh.net:8080/public/ImageCours/ChapitreMelot/0004.jpg',0.16090909090909092,0.26222222222222225,0.39111111111111113,0.4309090909090909,'Elodie%20Brun','Curiosite/Confusion/Frustration/','2016-05-15T13:59:57.932Z'),(242,'Je comprends mieux!','http://vps273360.ovh.net:8080/public/ImageCours/ChapitreMelot/0004.jpg',0.07727272727272727,0.27666666666666667,0.10333333333333333,0.4263636363636364,'Di%20Benedetto','Plaisir/','2016-05-15T13:03:20.781Z'),(243,'Clair et intéressant. Plaisir à lire et l\'impression d\'intégrer l\'information. Un sentiment de satisfaction en découle, ça motive à s\'engager pour la suite. ','http://vps273360.ovh.net:8080/public/ImageCours/ChapitreMelot/0004.jpg',0.30454545454545456,0.2633333333333333,0.38666666666666666,0.6345454545454545,'Elodie%20Brun','Plaisir/Curiosite/Engagement/','2016-05-15T14:04:55.412Z'),(244,'Intéressant ','http://vps273360.ovh.net:8080/p